  uri: 'http://localhost:3000/graphql',
  cache: new InMemoryCache(),
});


const myStore = configureStore({
  reducer: {
    todoSlice,
  },
});

function App() {
  return (
    <Provider store={myStore}>
      <div className="App">
        <h1>Todo List </h1>
        <TodoList />
      </div>
    </Provider>
  );
}

export default App;
